import React from 'react';

const Cv = () => {
  return (
    <div>
      <h1>My CV</h1>
      <p>Here is my experience and education:</p>
      Dale Warburton is an ambitious business and sales professional with a strong background in sales, marketing, and analysis. With a proven ability to drive sales revenue, solve problems strategically, and deliver strong performance measures, Dale excels in fostering lasting relationships and effective communication. Recently, Dale completed a coding bootcamp at CodeClan, where they studied Python, JavaScript, and Java, and is now eager to transition into a new career in the coding industry.
      
    </div>
  );
}

export default Cv;
